class Solution {

    /**
     * @param Integer[][] $grid
     * @return Integer[]
     */
    function goodSubsetofBinaryMatrix($grid) {
        $m = count($grid);
        $n = count($grid[0]);
        $bestSubset = [];

        for ($mask = 0; $mask < (1 << $m); $mask++) {
            $subset = [];
            $sums = array_fill(0, $n, 0);
            for ($i = 0; $i < $m; $i++) {
                if (($mask & (1 << $i)) > 0) {
                    $subset[] = $i;
                    for ($j = 0; $j < $n; $j++) {
                        $sums[$j] += $grid[$i][$j];
                    }
                }
            }

            $isValid = true;
            foreach ($sums as $sum) {
                if ($sum > floor(count($subset) / 2)) {
                    $isValid = false;
                    break;
                }
            }

            if ($isValid && count($subset) > count($bestSubset)) {
                $bestSubset = $subset;
            }
        }

        return $bestSubset;
    }
}
